import * as axs from './axs';

export const saveDiariesAction = (id, setPopSaved) => async (dispatch) =>{
        try{
            await axs.saveDiariesApi(id);
            dispatch({type: 'SAVE_DIARY', payload: id});
            setPopSaved(true);
            setTimeout( function() {setPopSaved (false)}, 2000);  

        } catch(error){
            console.log(error);
        }
}
